INSERT INTO "ezcontentobject_attribute" ("id","language_code","version","contentobject_id","contentclassattribute_id","data_text","data_int","data_float","attribute_original_id","sort_key_int","sort_key_string","data_type_string") VALUES (832,'eng-GB',1,232,189,'Use a few minutes to consider which forum you should post to. Posting it to a "General" forum is not as effective as posting to the "Install" forum if you question is about install-related questions. Don''t post in several different forums. If your question belongs in the "Install" forum, posting it in "General" or "Developer" aren''t very helpful. \015\012Consider this: If you post to the wrong forum the chances for someone actually answering it is lower than if you post it in the correct forum. Furthermore your off-topic post will just make it harder for those posting correctly to be noticed among those who post in the wrong forums.\015\012',0,0,0,0,'','eztext');
